import React from 'react';
import './App.css';
import NavBar from './components/NavBar';
import SeeProjects from './components/SeeProjects';
import {Grid} from "@material-ui/core"

function App() {
  return (
    <div className="App">
      <Grid container direction="column">
        <Grid item >
          <NavBar />
        </Grid >
        <Grid item container>
          <Grid item xs={2} lg={5}></Grid>
          <Grid item xs={1} lg={2}>

          </Grid>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
